import React, {useContext} from 'react';
import DataContext from '../data/DataContext';

const Home = () => {
  const { data } = useContext(DataContext);
  console.log(data)

  return(
  <main className="container">
  { data.map((e) => (
    <section>
    <span>{e.name}</span>
    </section>

))}

  </main>
  )
}

export default Home;
